import React from 'react';
import {Link} from 'react-router-dom';

function NavBar() {
    return(
        <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/AcctPag">Account Page</Link></li>
            <li><Link to="/Marketplace">Marketplace</Link></li>
        </ul>
    )
}

export default NavBar;
